#include <iostream>
#include <string>
#include <map>

using namespace std;

char findTheDifference(string s, string t);

int main() {
    std::string x = "";
    std::string y = "";
    std::cout << findTheDifference(x, y) << std::endl;
    return 0;
}

char findTheDifference(string s, string t) {
    map<char, int> map1;
    map<char, int> map2;

    /* T is guaranteed to be one letter larger than s so just put a saftey */
    for (int i = 0; i < t.size(); i++) {
        /* add the letter and increment its total occurrences */
        if (i <= s.size()) {
            map1[s[i]]++;
        }
        map2[t[i]]++;
    }

    char a = 'a';
    for (int i = 0; i < 26; i++) {
        if (map2[a] != map1[a]) {
            return a;
        }
        a++;
    }
    return 'E';
}